import React from 'react';
import './first.css';

function First() {
 return (
    <div className="App">
      <h1>What is Puppy Culture?</h1>
      <div cl>
      < img src='https://ucarecdn.com/07808bbc-1df5-43c7-bbb7-d796d2932bc1/-/format/auto/-/preview/3000x3000/-/quality/lighter/about-page_illustrations_german-shephard_600px.jpg' height={475} width={475}/>
      </div>
      <div>
        <p>On the top level, Puppy Culture is a socialization and training program specifically developed for puppies, from birth through the end of their critical socialization period.<br/> It includes age appropriate protocols and lessons laid out in an organized format. <br/>The program consists of videos, books and a Workbook, but that really does not get to the "why" of Puppy Culture, or what makes it differ.</p>
      </div>
    </div>
 );
}

export default First;
